function ajaxData($http, type, url, data, callback, errMsg) {
	if ($(".modal-backdrop.white").length < 1) {
		$('<div class="modal-backdrop in white"><i class="light-blue fa fa-2x fa-spinner fa-spin"></i></div>').appendTo("body");
	}
	$(".modal-backdrop.white").show();
	if(type=="GET"){
		if(url.indexOf("?")>-1){
			url=url+"&_random="+new Date().getTime();
		}else{
			url=url+"?_random="+new Date().getTime();
		}
	}
	$http({
		url:url,
		method: type,
		data: data
	}).success(function(res) {
		if (res && res.success) {
			callback(res);
			$(".modal-backdrop.white").hide();
		} else {
			$(".modal-backdrop.white").hide();
			alert(res.message || errMsg);
		}
	}).error(function(data,header) {
		$(".modal-backdrop.white").hide();
		if(header == 403){return alert('用户没权限！')}
		alert("连接服务器出错，请重试！");
	});
}
